import math

class Cheese(object):

    def __init__(self, n, s):
        self.n = n
        self.s = s
        self.holes = []
        self.volumes = []

    def add_hole(self, r, x, y, z):
        self.holes.append(Hole(r, x, y, z))

    def get_slices(self):
        self.calculate_volumes()
        slices = self.calculate_slices()
        return slices

    def calculate_volumes(self):
        for hole in self.holes:
            hole.calculate_volume()
            self.volumes.append(hole.volume)

    def calculate_slices(self):
        total_volume = self.calculate_total_volume()
        slice_volume = self.calculate_slice_volume(total_volume)
        slices = []
        for i in range(0, self.s):
            slices.append(slice_volume)
        return slices

    def calculate_total_volume(self):
        return 1000000 - sum(self.volumes)

    def calculate_slice_volume(self, total_volume):
        return total_volume / self.s

class Hole(object):

    def __init__(self, r, x, y, z):
        self.r = r
        self.x = x
        self.y = y
        self.z = z
        self.volume = 0

    def calculate_volume(self):
        self.volume = 4.0/3.0 * math.pi * self.r ** 3


def main():
    n, s = map(int, input().split())
    cheese = Cheese(n, s)
    for i in range(0, n):
        r, x, y, z = map(int, input().split())
        cheese.add_hole(r, x, y, z)
    slices = cheese.get_slices()
    for slice in slices:
        print("%.10f" % (slice / 1000000))

main()

import sys
import math

def find_weight(r, x, y, z, t):
    if z + r < t:
        return 0
    elif z - r > t:
        return 4.0/3.0 * math.pi * r**3
    else:
        return (4.0/3.0 * math.pi * r**3) - (1.0/3.0 * math.pi * (r - (t - z))**3)

def find_slices(n, s, holes):
    total_weight = 0
    for r, x, y, z in holes:
        total_weight += 4.0/3.0 * math.pi * r**3
    slice_weight = total_weight / s
    slices = []
    for i in range(s):
        slices.append(0)
    for r, x, y, z in holes:
        for i in range(s):
            slices[i] += find_weight(r, x, y, z, i * 100)
    weight = 0
    for i in range(s):
        weight += slices[i]
        slices[i] = slice_weight - slices[i]
    slices[-1] += weight - (slice_weight * s)
    return slices

def main():
    n, s = [int(x) for x in sys.stdin.readline().split()]
    holes = []
    for i in range(n):
        r, x, y, z = [int(x) for x in sys.stdin.readline().split()]
        holes.append((r, x, y, z))
    slices = find_slices(n, s, holes)
    for t in slices:
        print("{:.10f}".format(t/1000.0))

if __name__ == '__main__':
    main()
